a, b = map(float, input().split())

def judge(a, b):
    if a == 1:
        if b == 1:
            return 'Draw'
        else:
            return 'Alice'
    elif b == 1:
        return 'Bob'
    else:
        if a > b:
            return 'Alice'
        elif a < b:
            return 'Bob'
        else:
            return 'Draw'

print(judge(a, b))



n, m, c = map(int, input().split())
b = list(map(int, input().split()))
a = [list(map(int, input().split())) for _ in range(n)]
ans = 0
for i in range(n):
    total = c
    for j in range(m):
        total += b[j] * a[i][j]
    if total > 0:
        ans += 1
print(ans)


